import React from "react";
import {Navbar, Nav} from 'react-bootstrap';

import "../css/navbar.css"

export default class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar collapseOnSelect expand="lg" bg= "dark" variant="dark" className = "navbar navbar-static-top">
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav variant = "pills" className="mr-auto">
              <Nav.Item>
                <Nav.Link href="/">Home</Nav.Link>
              </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="images" href="/images">Images</Nav.Link>
              </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-2" href="/media">Media</Nav.Link>
              </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-3" href="/projects">Projects</Nav.Link>
              </Nav.Item>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}
